import React from 'react';

function TopInfo() {
    return (
        <div className='top_info'>
            <img className="logo" src="https://scontent.flwo1-1.fna.fbcdn.net/v/t39.30808-6/305160365_468074071999522_960093974201458544_n.png?_nc_cat=108&ccb=1-7&_nc_sid=5f2048&_nc_ohc=rUAwwP-nWYEAb7V_2qx&_nc_ht=scontent.flwo1-1.fna&oh=00_AfAUYyBn7Yl_aalJSWGJW7j64aFktkHFGQhywLaptolELQ&oe=6623733E" alt="Logo" />
            <span className="span">AcademicElite</span>
        </div>
    );
}

export default TopInfo;
